"use strict";function initialize(){d3.select(".chart").selectAll("div").data(data).enter().append("div").attr("class","bar").style("width",function(t){return x(t)+"px"}).text(function(t){return t})}var data=[parseInt(20*Math.random()),parseInt(20*Math.random()),parseInt(20*Math.random()),parseInt(20*Math.random()),parseInt(20*Math.random())],x=d3.scaleLinear().domain([0,d3.max(data)]).range([0,500]);document.addEventListener("DOMContentLoaded",function(t){initialize()});